Spidermacho, conocido tambien como el hombre que arana o el trepaculos, ha llegado a Barcelona y tiene un grave problema, en la Ciudad Condal no hay rascacielos con los que poder impulsarse usando sus lanzaredes. ?Que nuevas aventuras le aguardaran entre nosotros?, ?Que peligros le acecharan tras cada esquina de la ciudad?.
